import React, { Component } from 'react'

export class Ticket extends Component {
    constructor(){
        super();
        this.state={
            txnId: [],
            txns : []
        };


    }


    render() {

        this.state.txnId = this.props.history.location.state;
        var obj = this.state.txnId
        for (var key in obj) {
            if (obj.hasOwnProperty(key)) {
              var val = obj[key];
              this.state.txns.push(val)
            }
          }

        console.log(this.state.txns)

        return (
            <div id="content">

                <div id="ticket-details">
                <table className="table table-bordered table-xs-responsive table-hover">
                        <thead className="thead-dark">  
                        <tr>
                            <th>Ticket Number</th>
                            <th>Train Name</th>
                            <th>From</th>
                            <th>Departure Time</th>
                            <th>To</th>
                            <th>Arrival Time</th>
                            <th>Passenger Name</th>
                            <th>Age</th>
                            <th>Sex </th>
                            <th>Seat</th>
                            <th>Berth</th>



                        </tr>
                        </thead>
                        <tbody>

                        {
                             this.state.txns.map((item,index) => (
                                <tr key={index}   >
                                    <td>{item.ticket_number}</td>
                                    /


                                </tr>
                            ))
                        }

                        </tbody>
                    </table>
                </div>


                </div>


        )
    }
}

export default Ticket
